const ENDPOINT = "http://localhost:4003/db/users6302c54cde4c0d027c831749"

export default function GetFavs({ jwt  }) {
    return fetch(`${ENDPOINT}/favs`, {
      method: "GET",
      headers: {
        "Authorization": jwt,
        "Content-type": "aplication/json",
      }})
      .then((res) => {
        if (!res.ok) throw new Error("Response is NOT ok");
        return res.json();
      })
      .then((res) => {
        const { gifs} = res;
        return favs;
      });
  }
